import styled from 'styled-components';

export const Container = styled.div`
    background-color: red;
    width: 700px;
`;
export const Publicacao = styled.div`
    margin: 0px;
    padding: 10px;
    border: 0px solid rgb(204, 204, 204);
    background-color: blue;
`;
